import React from "react";
//import ReactDom from "react-dom/client";
import { LOGO } from "./utils/constants";
import { useState ,useEffect} from "react";
import { Link } from "react-router-dom";
const HeaderComponent = () => {

    const [btnRs,setbtnRS] = useState(["Login"]);
    console.log("header component");

    useEffect(()=>{
        console.log("useeffect call");
    },[btnRs])

    return (
        <div className="header flex bg-blue-500 text-white p-4">
            <div className="bg-blue-500 text-white p-4">This is a test</div>

            <div className="logo">
                <img src={LOGO} />
                
            </div>
            <div className="nav-items">
                <ul>
                    <li><Link to="/">Home</Link></li>
                   <li><Link to="/about">About Us</Link></li>
                   <li><Link to="/contact">Contact</Link></li>
                   <li><Link to="/grosery">Grosery</Link></li>
                    <li><button onClick={() => {btnRs == 'Login'? setbtnRS("LogOut"):setbtnRS("Login");
                }}>{btnRs}</button></li>
                </ul>

            </div>

        </div>
    )
}
export default HeaderComponent;
